import React, { useEffect } from 'react';
import { AdminPageStyled } from './AdminPage.style';

const AdminPage = () => {
  useEffect(() => {
    async function fetchMyAPI() {
      let response = await getRessources('post');
      setPosts(response);
    }
    fetchMyAPI();
  }, []);

  return (
    <AdminPageStyled>
      Ma page admin ici
    </AdminPageStyled>
  );
};

export { AdminPage };
